import React from "react";

function Card(props) {
  return (
    <div
      id="pokemon-item"
      onClick={() => {
        if (this.props.onClick !== "not") {
          () =>
            this.props.onClick([
              {
                id: props.id,
                name: props.name,
                imgUrl: props.imgUrl,
                HP: props.HP,
                ATK: props.ATK,
              },
            ]);
        } else {
          (e) => {
            e.preventDefault();
            ("dsfsad");
          };
        }
      }}
    >
      <img src={props.imgUrl} alt={props.name} />
      <p> {props.name}</p>
      <p>{`HP: ${props.HP}   ATK: ${props.ATK}`}</p>
    </div>
  );
}
export default Card;
